import React from "react";

export default function Meaning(props) {
  console.log(props.meaning); // Debugging: Check if `props.meaning` is defined

  if (!props.meaning) {
    return <p>No data available</p>; // Prevents crash if undefined
  }

  return <h3>{props.meaning.partOfSpeech || "Unknown"}</h3>;
}
